const items = (props) => {
    console.log(props.items)
    const items = props.items.map(item => (
        <p key={item.name}>
            <span>plus </span>
            {item.name}
            <input type="text" placeholder={item.amount.amount}/>
            {item.amount.units}
            <span><hr/></span>
        </p>
    ))
    return (items)
}




export default items
